d links, consider adding links towards these %1$s. %2$s'=>'"Osierocone treści" odnoszą się do treści (%1$s), które nie posiadają linków przychodzących, rozważ dodanie linków do tych treści: %1$s. %2$s','Orphaned content'=>'Osierocone treści','url'=>'url','readability score'=>'wynik czytelności','ID'=>'ID','Filter by redirect type'=>'Filtr według typu przekierowania','All redirect types'=>'Wszystkie typy przekierowań','If you need a list of all public posts, terms and related keyphrases, you can generate a CSV file using the %s button below.'=>'Jeśli potrzebujesz listy wszystkich publicznych wpisów, taksonomii i związanych z nimi fraz kluczowych, możesz wygenerować plik CSV używając przycisku %s poniżej.','Export keyphrases to a CSV file'=>'Wyeksportuj frazy kluczowe do pliku CSV','You can add or remove columns to be included in the export using the checkboxes below.'=>'Możesz dodać lub usunąć kolumny, które mają być uwzględnione w eksporcie za pomocą poniższych pól wyboru.','Export URL'=>'Eksportuj URL','Export title'=>'Eksportuj tytuł','Export readability score'=>'Eksportuj wynik czytelności','Please note:'=>'Uwaga:','The first row in this file is the header row. This row should be ignored when parsing or importing the data from the export.'=>'Pierwszy wiersz w tym pliku to wiersz nagłówka. Ten wiersz powinien być ignorowany podczas przetwarzania lub importu danych z eksportu.','Exporting data can take a long time when there are many posts, pages, public custom post types or terms.'=>'Eksport danych może zająć więcej czasu, jeśli w bazie jest dużo postów.','Plain redirects'=>'Zwykłe przekierowania','Regular Expression redirects'=>'Przekierowania z wyrażeń regularnych','Redirects settings'=>'Ustawienia przekierowań','post_type of a post or the taxonomy of a termtype'=>'typ','seo title'=>'tytuł seo','Export SEO title'=>'Eksportuj tytuł SEO','Export meta description'=>'Eksportuj opis meta','keyphrase'=>'fraza kluczowa','keyphrase score'=>'ocena frazy kluczowej','Export keyphrases'=>'Eksportuj frazy kluczowe','Export keyphrase scores'=>'Eksportuj punkty frazy kluczowej','https://yoa.st/2jc'=>'https://yoa.st/2jc','Yoast SEO Premium'=>'Yoast SEO Premium','All redirects have been imported successfully. Go to the %1$sredirects overview%2$s to see the imported redirects.'=>'Wszystkie przekierowania zostały zaimportowane pomyślnie. Przejdź do %1$slisty przekierowań%2$s, aby zobaczyć zaimportowane przekierowania.','No redirects have been imported. Probably they already exist as a redirect. Go to the %1$sredirects overview%2$s to see the existing redirects.'=>'Żadne przekierowania nie zostały zaimportowane. Prawdopodobnie takie przekierowania już istnieją. Przejdź do %1$slisty przekierowań%2$s, aby zobaczyć istniejące przekierowania.','Imported %1$s/%2$s redirects successfully. Go to the %3$sredirects overview%4$s to see the imported redirect.'=>'Przekierowanie zostały pomyślnie zaimportowane: %1$s/%2$s. Przejdź do %3$slisty przekierowań%4$s, aby zobaczyć zaimportowane przekierowanie.' . "\0" . 'Przekierowania zostały pomyślnie zaimportowane: %1$s/%2$s. Przejdź do %3$slisty przekierowań%4$s, aby zobaczyć zaimportowane przekierowania.' . "\0" . 'Przekierowania zostały pomyślnie zaimportowane: %1$s/%2$s. Przejdź do %3$slisty przekierowań%4$s, aby zobaczyć zaimportowane przekierowania.','Redirect import failed: the selected redirect plugin is not installed or activated.'=>'Import przekierowań nie powiódł się: wybrana wtyczka do przekierowań nie jest zainstalowana lub włączona.','CSV import failed: No file selected.'=>'Import CSV nie powiódł się: Nie wybrano żadnego pliku.','CSV import failed: the provided file is larger than %1$s.'=>'Import CSV nie powiódł się: dostarczony plik jest większy niż %1$s.','CSV import failed: the provided file is not a CSV file.'=>'Import CSV nie powiódł się: dostarczony plik nie jest plikiem CSV.','Redirect import failed: we can\'t recognize this type of import.'=>'Import przekierowań nie powiódł się: nie rozpoznano tego typu importu.','Stale cornerstone content'=>'Stare kluczowe treści','Stale cornerstone content refers to cornerstone content that hasn’t been updated in the last 6 months. Make sure to keep these %1$s up-to-date. %2$sLearn more about cornerstone content%3$s.'=>'Stare kluczowe treści odnoszą się do kluczowych treści, które nie były aktualizowane od 6 miesięcy. Upewnij się, aby aktualizować treści: %1$s. %2$sDowiedz się więcej o kluczowych treściach%3$s.','Choose a CSV file from your computer:'=>'Wybierz plik CSV z komputera:','Undo'=>'Cofnij','Redirect not deleted.'=>'Przekierowanie nie zostało usunięte.','Something went wrong when deleting this redirect.'=>'Coś poszło nie tak podczas usuwania przekierowania.','The old URL for your redirect is not relative. Only the new URL is allowed to be absolute. Make sure to provide a relative old URL.'=>'Stary adres URL dla Twojego przekierowania nie jest relatywny. Tylko nowe adresy URL mogą być adresami absolutnymi. Upewnij się, że wprowadziłeś relatywny adres URL.','%1$s created a %2$sredirect%3$s from the old post URL to the new post URL.'=>'%1$s utworzył %2$sprzekierowanie%3$s ze starego adresu wpisu na nowy adres wpisu.','%1$s created a %2$sredirect%3$s from the old term URL to the new term URL.'=>'%1$s utworzono %2$sprzekierowanie%3$s ze starego formatu URL do nowego formatu URL.','Ok'=>'Ok','Table of contents'=>'Tabela zawartości']];